import React from 'react';
import DashBoard from '../components/dashboard/DashBoardIndex'
import AdminView from '../components/dashboard/A';

const DashPage = () => {
    return (
        <>
            <DashBoard/>
         <br/>
        <br/>
        <br/>
        <br/>
        <AdminView/>
        </>
    );
}

export default DashPage;
